import React, { Component, useEffect, useState } from "react";
import { Form, InputGroup } from "react-bootstrap";
import Paper from "@mui/material/Paper";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TablePagination from "@mui/material/TablePagination";
import TableRow from "@mui/material/TableRow";
import { Navigate } from "react-router-dom";
import Button from "@mui/material/Button";
import Col from "react-bootstrap/Col";
import Row from "react-bootstrap/Row";

export default function OverdueAdmin() {
  const [search, setSearch] = useState("");
  const [loading, setLoading] = useState(true);
  const [items, setItems] = useState([]);
  const handleInputChange = (e) => {
    setSearch(e.target.value);
  };

  useEffect(() => {
    InstallmentGet()
  }, []);

  const InstallmentGet = () => {
    var myHeaders = new Headers();
    myHeaders.append("Content-Type", "application/json"); 
    var requestOptions = {
      method: 'GET',
      headers: myHeaders,
      redirect: 'follow'
    };
    
   fetch("http://localhost:3001/api/v1/installments", requestOptions)
      .then(response => response.text())
      .then(result => console.log(result))
      .catch(error => console.log('error', error));
  };

  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  return(    <diV>
    <Row>
      <div class="search">
        <Col>
          <Form>
            <InputGroup>
              <Form.Control
                onChange={handleInputChange}
                placeholder="ค้นหา"
              />
            </InputGroup>
          </Form>
        </Col>
      </div>
      <div class="additem">
        <Col>
          <button
            class="btn btn-success btn-add-motor"
            onClick={() => {
              setGotoAddMotorcycle(true);
            }}
          >
            เพิ่มข้อมูล{" "}
          </button>
        </Col>
      </div>
    </Row>
    {loading ? (
      <p>Loading...</p>
    ) : (
      <Paper sx={{ width: "100%", overflow: "hidden" }}>
        <TableContainer sx={{ maxHeight: 440 }}>
          <Table stickyHeader aria-label="sticky table">
            <TableHead>
              <TableRow>
                <TableCell>ชื่อลูกค้า</TableCell>
                <TableCell>เลขตัวถัง</TableCell>
                <TableCell>เลขทะเบียน</TableCell>
                <TableCell>แก้ไขข้อมูล</TableCell>
                <TableCell>ลบข้อมูล</TableCell>
              </TableRow>
            </TableHead>
            <TableBody>
              {items
                // .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
                // .filter((row) => {
                //   return (
                //     search.trim() === "" ||
                //     row.USER_FULLNAME.toLowerCase().includes(
                //       search.toLowerCase()
                //     ) ||
                //     row.MOTORCYCLE_BUCKET_NUMBER.toLowerCase().includes(
                //       search.toLowerCase()
                //     ) ||
                //     row.MOTORCYCLE_REGISTRATION_NUMBER.toLowerCase().includes(
                //       search.toLowerCase()
                //     )
                //   );
                // })
                .map((row) => (
                  <TableRow
                    key={row.name}
                    sx={{ "&:last-child td, &:last-child th": { border: 0 } }}
                  >
                    <TableCell>{row.INSTALLMENTS_ID}</TableCell>
                    <TableCell>{row.MOTORCYCLE_ID}</TableCell>
                    <TableCell>
                      {row.INSTALLMENTS_NO}
                    </TableCell>
                    <TableCell>
                      <Button
                        type="button"
                        class="btn btn-warning"
                        onClick={() => MotorcycleUpdate(row.MOTORCYCLE_ID)}
                      >
                        แก้ไข
                      </Button>
                    </TableCell>
                    <TableCell>
                      <Button
                        type="button"
                        class="btn btn-danger"
                        onClick={() => MotorcycleDelete(row.MOTORCYCLE_ID)}
                      >
                        ลบ
                      </Button>
                    </TableCell>
                  </TableRow>
                ))}
            </TableBody>
          </Table>
        </TableContainer>
        <TablePagination
          rowsPerPageOptions={[10, 25, 100]}
          component="div"
          count={items.length}
          rowsPerPage={rowsPerPage}
          page={page}
          onPageChange={handleChangePage}
          onRowsPerPageChange={handleChangeRowsPerPage}
          labelRowsPerPage="จำนวนแถวต่อหน้า:"
          labelDisplayedRows={({ from, to, count }) =>
            `${from}-${to} จากทั้งหมด ${count}`
          }
        />
      </Paper>
    )}
  </diV>)
}
